import React, { useState } from "react";

function Home() {
	const [isOpen, setIsOpen] = useState(false);

	const toggle = () => {
		setIsOpen(!isOpen);
	};
	const mystyle = {
		background: "none",
	};
	return (
		<div style={mystyle}>
			<SideBar isOpen={isOpen} toggle={toggle} />
			<Navbar toggle={toggle} />
		</div>
	);
}

export default Home;
